import React from 'react';
import s from './Post.module.css';

const Post = (prop) => {
    return (
        <div className={s.item}>
            <img src='https://pbs.twimg.com/profile_images/1122995987730112513/sPturtT9.jpg'/>
        </div>
    );
}

export default Post;
